package main

import "fmt"

type set map[byte]struct{}

func main() {
	fmt.Println(kmp(""))
	fmt.Println(strStr("", ""))
}

func strStr(haystack string, needle string) int {
	if len(needle) < 1 {
		return 0
	}
	dp := kmp(needle)
	for i, j := 0, 0; i < len(haystack); i++ {
		j = dp[j][haystack[i]]
		if j == len(needle) {
			return i - j + 1
		}
	}
	return -1
}

func kmp(needle string) (dp []map[byte]int) {
	dp = make([]map[byte]int, len(needle))
	dp[0] = make(map[byte]int)
	dp[0][needle[0]] = 1
	charsSet := make(set, len(needle))
	charsSet[needle[0]] = struct{}{}
	sl := 0
	for fs := 1; fs < len(needle); fs++ {
		dp[fs] = make(map[byte]int)
		charsSet[needle[fs]] = struct{}{}
		dp[fs][needle[fs]] = dp[fs-1][needle[fs-1]] + 1
		for k, _ := range charsSet {
			if k == needle[fs] {
				continue
			}
			dp[fs][k] = dp[sl][k]
		}
		sl = dp[sl][needle[fs]]
	}
	return
}
